import React, { useState, useEffect } from 'react';
import SurfaceCard from './SurfaceCard';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
import Typography from '@mui/material/Typography';

import TextField from '@mui/material/TextField';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import Button from '@mui/material/Button';
import EquationEditor from 'equation-editor-react';
import evaluatex from '../node_modules/evaluatex/dist/evaluatex';

import {evaluate, create, all} from 'mathjs';

function SurfaceDialog(props) {
  const [equation, setEquation] = useState('2+x');

  const handleSave = () => {
    let fn = evaluatex(equation);
    let result = fn({ x: 3, y: 0, z: 0 });
    console.log('EVALUACION EN X=3: ' + result);
    
    const math = create(all)

    // defined methods can be used in both JavaScript as well as the parser
    math.import({
      myConstant: 42,
      sdf: function (x) {
        return fn(x);
      }
    })

    console.log(math.evaluare('sdf(3)')); // 84
  };

  return (
    <Dialog open={props.open} onClose={props.handleClose}>
      <DialogTitle>New Surface</DialogTitle>
      <DialogContent>
        <DialogContentText>
          Type implicit equation of the surface: {equation}
        </DialogContentText>
        <Grid container spacing={2}>
        <Grid item xs={4}>
            <Typography align="left">Name</Typography>
          </Grid>
          <Grid item xs={8}>
          <TextField
                  id="standard-size-small"
                  defaultValue="Small"
                  size="small"
                  variant="standard"
                />
          </Grid>


          <Grid item xs={4}>
            <Typography align="left">Implicit</Typography>
          </Grid>
          <Grid item xs={8}>
            <Box sx={{ border: '1px dashed grey' }}>
              <EquationEditor
                value={equation}
                onChange={setEquation}
                autoCommands="pi theta sqrt sum prod alpha beta gamma rho"
                autoOperatorNames="sin cos tan"
              />
            </Box>
          </Grid>

          
        </Grid>
      </DialogContent>
      <DialogActions>
        <Button onClick={props.handleClose}>Cancel</Button>
        <Button onClick={handleSave}>Save</Button>
      </DialogActions>
    </Dialog>
  );
}
export default function SurfacePage() {
  const [dialogOpen, setDialogOpen] = useState(false);

  return (
    <Box>
      <Fab
        style={{ position: 'absolute', bottom: 16, right: 16 }}
        color="primary"
        aria-label="add"
        onClick={() => setDialogOpen(true)}
      >
        <AddIcon />
      </Fab>
      <SurfaceDialog
        open={dialogOpen}
        handleClose={() => setDialogOpen(false)}
      />
      <Grid
        container
        direction="row"
        justifyContent="flex-start"
        alignItems="flex-start"
        spacing={2}
      >
        <Grid item>
          <SurfaceCard />
        </Grid>
        <Grid item>
          <SurfaceCard />
        </Grid>
        <Grid item>
          <SurfaceCard />
        </Grid>
        <Grid item>
          <SurfaceCard />
        </Grid>
        <Grid item>
          <SurfaceCard />
        </Grid>
        <Grid item>
          <SurfaceCard />
        </Grid>
        <Grid item>
          <SurfaceCard />
        </Grid>
      </Grid>
    </Box>
  );
}
